import React, { useState } from 'react';
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Check = ()=> {
    const [email,setEmail] = useState('')
    const [password,setPassword] = useState('')
    const navigate = useNavigate();
    const submit = async (e)=>{
        e.preventDefault()
        try {
            await axios.post("http://localhost:4000/users/signin",{email,password})
            navigate("/")
        }catch(e){
            console.log(e);
        }
    }

    return (
        <div>
        <form action="POST">
        <textarea name="text" placeholder="Enter your email" onChange={(e)=>{setEmail(e.target.value)}}></textarea>
        <textarea name="text"  placeholder="Enter your password" onChange={(e)=>{setPassword(e.target.value)}}></textarea>

       <input type="submit" onClick={submit} value="submit" />
       </form>
        </div>
    )
}

export default Check;
